Size size(640, 480);

vector<KeyPoint>* getKeyPointsFromJson(char* json) {
    FILE* fp = fopen(json, "r");
    char readBuffer[65536];
    FileReadStream is(fp, readBuffer, sizeof(readBuffer));
    Document keyPoints;
    keyPoints.ParseStream(is);
    fclose(fp);

    vector<KeyPoint>* keypoints_monument = new vector<KeyPoint>();
    const Value& array = keyPoints["keypoints"];

    for (SizeType i = 0; i < array.Size(); i++) {
        const Value& point = array[i];
        keypoints_monument->push_back(KeyPoint(point["x"].GetDouble(), point["y"].GetDouble(), point["size"].GetDouble(), point["angle"].GetDouble(), point["response"].GetDouble(), point["octave"].GetInt(), point["class_id"].GetInt()));
    }

    return keypoints_monument;
}

Mat* getMatFromJson(char* json) {
    FILE* fp = fopen(json, "r");
    char readBuffer[65536];
    FileReadStream is(fp, readBuffer, sizeof(readBuffer));
    Document descriptor;
    descriptor.ParseStream(is);
    fclose(fp);

/*
    char* data = (char*) base64_decode(descriptor["data"].GetString()).c_str();
    cout << data << endl;
    unsigned char* dataUC = new unsigned char[strlen(data) + 1];
    memcpy(dataUC, data, strlen(data));
    dataUC[strlen(data)] = 0;
*/

    // Retrieve the data to decode
    string toDecode = descriptor["data"].GetString();
    string toDecodeFiltered;

    // Remove the "\" and replace the " " by "+"
    std::replace(toDecode.begin(), toDecode.end(), ' ', '+');
    std::remove_copy( toDecode.begin(), toDecode.end(), std::back_inserter(toDecodeFiltered), '\\');
    
    //Display data encode
    //cout << toDecodeFiltered;
    ofstream myfile;
    myfile.open ("../cpp/todecodefiltered.txt");
    myfile << toDecodeFiltered;
    myfile.close();

    string myDecode = base64_decode(toDecodeFiltered);
    
    char b[32*4000];
    
    strcpy((char*) b, myDecode.c_str());

   /* std::stringstream ss;
    for (size_t i = 0; i < 32*4000; ++i) {
        if (i != 0){
            ss << ",";
        }
        ss <<(int) b[i];
    }*/
    //Display data decoded
    //cout << ss.str() << endl;
    cout << endl;
    Mat* mat = new Mat(descriptor["rows"].GetInt(), descriptor["cols"].GetInt(), descriptor["type"].GetInt(), b);

    return mat;
}

//function to use for mobile imae detection
//params: keypoints of the source and dest image, descriptors of the two images, the accuracy of the test and the acceptance ratio
double checkDescriptors(vector<KeyPoint> keypoints_object, vector<KeyPoint> keypoints_scene, Mat descriptor1, Mat descriptor2, double accuracy, double expectedRatio) {

    //-- Step 3: Matching descriptor vectors using FLANN matcher
    BFMatcher matcher(NORM_HAMMING2, false);
    std::vector<vector<DMatch > > matches;

    matcher.knnMatch(descriptor1, descriptor2, matches, 2);

    //-- Draw only "good" matches (i.e. whose distance is less than 3*min_dist )
    std::vector< DMatch > good_matches;
    std::vector<Point2f> obj;
    std::vector<Point2f> scene;

    for (int i = 0; i < (int) matches.size(); i++) {
        if (matches[i][0].distance < matches[i][1].distance * accuracy) {
            good_matches.push_back(matches[i][0]);
            obj.push_back(keypoints_object[ matches[i][0].queryIdx ].pt);
            scene.push_back(keypoints_scene[ matches[i][0].trainIdx ].pt);
        }
    }

    //-- Localize the object
    double imgArea = size.height * size.width;
    double areaFound = 0;
    double ratio = 0;

    //need at least 4 match
    if (good_matches.size() >= 4) {
        Mat H = findHomography(obj, scene, CV_RANSAC, 0);

        //-- Get the corners from the image_1 ( the object to be "detected" )
        std::vector<Point2f> obj_corners(4);
        obj_corners[0] = cvPoint(0, 0);
        obj_corners[1] = cvPoint(size.height, 0);
        obj_corners[2] = cvPoint(size.height, size.width);
        obj_corners[3] = cvPoint(0, size.width);
        std::vector<Point2f> scene_corners(4);

        perspectiveTransform(obj_corners, scene_corners, H);
        areaFound = contourArea(scene_corners);
        imgArea = size.height * size.width;
        ratio = areaFound / imgArea;
    }
    //return (ratio > expectedRatio);
    return ratio;
}

